export class Elemento {
  constructor(id = 0, controlador = '') {
    this.id = id;
    this.controlador = controlador;
  }

  inicializar(datos) {
    if (!!datos) {
      this.id = !!datos.id ? datos.id : 0;
      this.controlador = !!datos.controlador ? datos.controlador : '';
    }
  }

}
